Best Of The Big House

History Documentary hosted by Paul Sorvino, published by History Channel in 2002 - English narration


Information
------------------------------

They are home to habitual criminals and incorrigibles, with long histories of overcrowding, protests, riots, violence and bloodshed. Visit some of the most intense and intriguing prisons in the United States, as THE BIG HOUSE profiles the penitentiaries, prisoners and wardens that continue to fascinate those on the outside. HISTORY dives deep into the correctional institutions that have hosted some of the world's most infamous criminals, with powerful insights from current and retired prison wardens and correctional officers.

Narrated by Paul Sorvino
Produced by GREYSTONE COMMUNICATIONS, INC. For THE HISTORY CHANNEL

4)  Leavenworth 
Leavenworth U.S. Penitentiary was built in the early 1900s near Fort Leavenworth, Kansas. Leavenworth was the largest maximum security federal prison in the United States from 1903 until 2005. Few prisons are more famous than Leavenworth which was the end of the line for such infamous characters as desperado George &quot;Machine Gun&quot; Kelly and mobster George &quot;Bugs&quot; Moran.

